function render() {

    gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);


    if (mode == 1) {
        for (var i = 0; i < meshVertices.length; i+=3) {
            gl.drawArrays(gl.LINE_LOOP, i, 3);
        }
    }
    else {
        gl.drawArrays(gl.TRIANGLES, 0, (meshVertices.length) / 3);
    }
    //window.requestAnimationFrame(render); // WIRESDA KEYBOARD EVENTSTEN SONRA FPS DÜŞÜRÜYOR
}

function prepareObject() {
    for (var i = 0; i < quads.length; i += 12) {
        addAttributes(quads[i] - 1, quads[i + 1] - 1, quads[i + 2] - 1);
        addAttributes(quads[i + 3] - 1, quads[i + 4] - 1, quads[i + 5] - 1);
        addAttributes(quads[i + 6] - 1, quads[i + 7] - 1, quads[i + 8] - 1);

        addAttributes(quads[i] - 1, quads[i + 1] - 1, quads[i + 2] - 1);
        addAttributes(quads[i + 6] - 1, quads[i + 7] - 1, quads[i + 8] - 1);
        addAttributes(quads[i + 9] - 1, quads[i + 10] - 1, quads[i + 11] - 1);
    }

    for (var i = 0; i < triangles.length; i += 9) {
        addAttributes(triangles[i] - 1, triangles[i + 1] - 1, triangles[i + 2] - 1);
        addAttributes(triangles[i + 3] - 1, triangles[i + 4] - 1, triangles[i + 5] - 1);
        addAttributes(triangles[i + 6] - 1, triangles[i + 7] - 1, triangles[i + 8] - 1);
    }
}

function addAttributes(vIndex, tIndex, nIndex) {
    meshVertices.push(vertices[3 * vIndex], vertices[3 * vIndex + 1], vertices[3 * vIndex + 2]);
    meshTexCoords.push(textureCoords[2 * tIndex], textureCoords[2 * tIndex + 1]);
    meshNormals.push(normals[3 * nIndex], normals[3 * nIndex + 1], normals[3 * nIndex + 2]);
}


function isPowerOfTwo(value) {
    return value & (value - 1) == 0;
}

